Что же о себе написать.  Ну маленькая, худенькая, общительная. Люблю поесть - вкусно. Пофилософствовать и даже иногда помечтать. Нравиться учиться, но вот если бы не врождённая лень , стеснительность и некоторая "тугоумость" была бы уже доктором наук, не меньше, и уже нобелевскую премию получила бы, это точно.  Лет десять назад даже начала ( с подругой Оксаной) писать книгу о  романтической любви вампира и простой девушки.  Но "тяму", наверное, не хватило. Лежит теперь наш опус в рукописном стиле (две маленькие главы с зарисовками) в моем ящике с остальными конспектами.  И дописывать поздно, и выбросить жалко. Идея была хорошая.  Но сумерки конечно круче, спору нет! 
Мечтаю о своем доме с маленьким садом и большим балконом.
Люблю животных.  Мои домашние  питомцы:
- два сибирских хомяка по кличке Толстый (ленивый) и Тощий (неугомонный);
- два джунгарских хомяка - Лупоглазик(крохотный совсем) и Его Мать(пришибленная немного);
- кошка по кличке Кармашек (наглая очень), сейчас в аренду ее сдала брату - мышей ловить;
- ящерка - Маруська (никак не хочет впадать в спячку);
- собака - откликается на Эй, так ее и зовем - Эй-ка, умеет строить рожицы;
-  а еще муж (любимый конечно) - сатрап, тиран и сумасброд. Милый такой, он у меня настоящий ЗВЕрь - породы сексуальный ленивец.  
   Его любимые фразы:
- "Жена! Целуй меня.";
- "Жена! Целуй меня, а то уйду! (на работу после обеда);
- " жена! корми меня! (вечером с работы);
- " жена, на стол наготовила? А почему не зовешь";
- " Слезь с меня, ты тяжелая, я поел только что,"(для справки: весовая категория - он 83кг, я 43кг).
    Очень любит животных. Любовь к ним проявляется во фразе: "кушай, кушай , кошечка, первого хомячка , я не считаю.  Кушай, кушай, кошечка, второго хомячка, я не считаю...и т.д. " 
  особые приметы:
- прекрасный образчик гуманоидной расы.
- две ходилки, две хваталки, одна размножалка.  Еще как и положено у гуманоидов  одна голова (посередине).  Не ней два глаза ( серые, но хитрые-хитрые), два уха (небольшие совсем), один нос (почти идеальной греческой формы), и конечно рот, которым он матерится. На голове иногда бывает борода и волосы. Красавчик, одним словом. Он у меня большой, теплый, мягкий и ... лысый(летом), а еще голодный (очень часто). 
   Любимая поза: лежа на диване, в нарочито расслабленно- сексуальной позе ( на боку, одна рука под щечку, другая занята пультом от телевизора или мышкой от компьютера).  Другая любимая поза: все на том же продавленном диване, только лежа на спине - одна рука под головой, другая как обычно занята пультом. иногда с кошкой на пузике, если не в настроении, то с кошкой в ногах.
    Если даешь подержать хомяков, когда надо  чистить клетку, то уже через минуту раздаются истошные крики: -"забери их от меня, они разбегаются!" Детей пока нет - боюсь не справлюсь с такой оравой - съедят без хрена и соли. Но все же... любовь ,как говорится... прекрасна. А  в супружеской жизни столько интересного. Люблю своего мужа, как хорошо, что он у меня есть. Он мой вдохновитель. Я наверное могла бы стать неплохим бумагомарателем, то есть писателем, вот только бы, наконец, научиться правописанию.
